/**
 * Main function to update all forms based on the mapping and data from sheets.
 */
function updateForms() {
  const startTime = new Date();
  const { ssID, formMappings } = CONFIG;
  try {
    const spreadsheet = SpreadsheetApp.openById(ssID);
    Object.entries(formMappings).forEach(([formID, sheetName]) => {
      var _wsData$labels, _wsData$data;
      const wsData = getSheetData_(spreadsheet, sheetName);
      if (
        !(
          wsData !== null &&
          wsData !== void 0 &&
          (_wsData$labels = wsData.labels) !== null &&
          _wsData$labels !== void 0 &&
          _wsData$labels.length
        ) ||
        !(
          wsData !== null &&
          wsData !== void 0 &&
          (_wsData$data = wsData.data) !== null &&
          _wsData$data !== void 0 &&
          _wsData$data.length
        )
      ) {
        console.warn(
          `No valid data found in sheet "${sheetName}" for form "${formID}".`
        );
        return;
      }
      const form = FormApp.openById(formID);
      console.info(
        `Updating form "${formID}" with data from sheet "${sheetName}".`
      );
      updateFormDropdowns_(form, wsData);
    });
  } catch (error) {
    console.error(`Error during form update process: ${error.message}`);
  }
  console.log(`Execution completed in ${(new Date() - startTime) / 1000}s.`);
}

/**
 * Retrieves sheet data (labels and rows) as an object.
 *
 * @param {GoogleAppsScript.Spreadsheet.Spreadsheet} spreadsheet - The spreadsheet object.
 * @param {string} sheetName - The name of the sheet.
 * @returns {Object|null} - An object with labels and data, or null if the sheet is invalid.
 */
function getSheetData_(spreadsheet, sheetName) {
  try {
    const sheet = spreadsheet.getSheetByName(sheetName);
    if (!sheet) throw new Error(`Sheet "${sheetName}" not found.`);
    const { headerRow, startRow } = CONFIG;
    const labels = sheet
      .getRange(headerRow, 1, 1, sheet.getLastColumn())
      .getValues()[0];
    const data = sheet
      .getRange(
        startRow,
        1,
        sheet.getLastRow() - startRow + 1,
        sheet.getLastColumn()
      )
      .getValues();
    return {
      labels,
      data
    };
  } catch (error) {
    console.error(
      `Error retrieving data from sheet "${sheetName}": ${error.message}`
    );
    return null;
  }
}

/**
 * Updates dropdowns in the form based on the sheet data.
 *
 * @param {GoogleAppsScript.Forms.Form} form - The form object.
 * @param {Object} wsData - The worksheet data with labels and rows.
 */
function updateFormDropdowns_(form, wsData) {
  const { labels, data } = wsData;
  labels.forEach((label, index) => {
    try {
      const options = [
        ...new Set(
          data
            .map((row) => {
              var _row$index;
              return (_row$index = row[index]) === null || _row$index === void 0
                ? void 0
                : _row$index.trim();
            })
            .filter(Boolean)
        )
      ];
      if (!options.length) {
        console.warn(
          `No valid options for dropdown with label "${label}" in the form.`
        );
        return;
      }
      updateDropdownUsingTitle_(form, label, options);
    } catch (error) {
      console.error(
        `Error updating dropdown for label "${label}": ${error.message}`
      );
    }
  });
}

/**
 * Finds a dropdown by title in the form and updates it with new values.
 *
 * @param {GoogleAppsScript.Forms.Form} form - The form object.
 * @param {string} title - The title of the dropdown item.
 * @param {string[]} values - The list of values to populate the dropdown.
 */
function updateDropdownUsingTitle_(form, title, values) {
  try {
    const item = form
      .getItems()
      .find((item) => item.getTitle().toLowerCase() === title.toLowerCase());
    if (
      (item === null || item === void 0 ? void 0 : item.getType()) ===
      FormApp.ItemType.LIST
    ) {
      updateDropdown_(item.asListItem(), values);
    } else {
      console.warn(`No list item found with title "${title}" in the form.`);
    }
  } catch (error) {
    console.error(
      `Error accessing dropdown for title "${title}": ${error.message}`
    );
  }
}

/**
 * Updates a dropdown list item with new choice values.
 *
 * @param {GoogleAppsScript.Forms.ListItem} listItem - The list item object.
 * @param {string[]} values - The choice values to set.
 */
function updateDropdown_(listItem, values) {
  try {
    listItem.setChoiceValues(values);
  } catch (error) {
    console.error(`Error updating dropdown values: ${error.message}`);
  }
}

#include<iostream>
#include<bits/stdc++.h>
using namespace std;
#define ll long long int
 
// detect and print cycle
// in an undirected graph : if found visited and not parent : cycle
// in directed : apply topo sort, if array size == n => no cycle else cycle
// dfs + stack will help to print cycle : let's see in below code
 
void dfs(ll node, vector < vector < ll >> & graphs, vector < bool > & visited, vector < ll > & s, map < ll, bool > & st_pres, bool & one_time) {
    if(one_time){
        return;
    }
    visited[node] = true;
    s.push_back(node);
    st_pres[node] = true;
    for (ll i = 0; i < graphs[node].size(); i++) {
        if (!visited[graphs[node][i]]) {
            dfs(graphs[node][i], graphs, visited, s, st_pres, one_time);
            if(one_time){
                return;
            }
        }
        else {
            if (st_pres.count(graphs[node][i]) != 0 && st_pres[graphs[node][i]] == true && one_time == false) {
                one_time = true;
                vector<ll>ans;
                ans.push_back(graphs[node][i]);
                while (s.size()>0 && *(s.end()-1) != graphs[node][i]) {
                    ans.push_back(*(s.end()-1));
                    s.pop_back();
                }
                ans.push_back(graphs[node][i]);
                reverse(ans.begin(), ans.end());
                if (ans.size() != 0) {
                    cout << ans.size() << endl;
                    for (ll i = 0; i < ans.size(); i++) {
                        cout << ans[i] << " ";
                    }
                    cout << endl;
                }
                return;
            }
        }
    }
    s.pop_back();
    st_pres[node] = false;
}
 
void solve() {
    ll n, m;
    cin >> n >> m;
    vector < vector < ll >> graphs(n + 1);
    vector < ll > indegree(n + 1);
    for (ll i = 0; i < m; i++) {
        ll a, b;
        cin >> a >> b;
        graphs[a].push_back(b);
        indegree[b]++;
    }
    queue < ll > q;
    for (ll i = 1; i <= n; i++) {
        if (indegree[i] == 0) {
            q.push(i);
        }
    }
    ll ct = 0;
    while (!q.empty()) {
        ll a = q.front();
        q.pop();
        ct++;
        for (ll i = 0; i < graphs[a].size(); i++) {
            indegree[graphs[a][i]]--;
            if (indegree[graphs[a][i]] == 0) {
                q.push(graphs[a][i]);
            }
        }
    }
    if (ct == n) {
        cout << "IMPOSSIBLE" << endl;
    }
    else {
        // cycle present
        vector < bool > visited(n + 1, false);
        vector < ll > s;
        map < ll, bool > st_pres;
        bool one_time = false;
        for (ll i = 1; i <= n; i++) {
            if (one_time == true) {
                break;
            }
            if(!visited[i]){
                s.clear();
                st_pres.clear();
                dfs(i, graphs, visited, s, st_pres, one_time);
            }
        }
    }
}
 
int main() {
    // freopen("blist.in","r",stdin);
    // freopen("blist.out","w",stdout);
    solve();
}

